import React, { useCallback, useState } from "react";
import { useDropzone } from "react-dropzone";
import {
  Box,
  Button,
  Container,
  Typography,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Paper,
  CircularProgress,
} from "@mui/material";
import { CloudUpload, InsertDriveFile } from "@mui/icons-material";
import axios from "axios";
import { Document, Page, pdfjs } from "react-pdf";

pdfjs.GlobalWorkerOptions.workerSrc = new URL(
  "pdfjs-dist/build/pdf.worker.min.js",
  import.meta.url
).toString();

const DocumentUpload = () => {
  const [files, setFiles] = useState([]);
  const [fileUrl, setFileUrl] = useState("");
  const [uploadMessage, setUploadMessage] = useState("");
  const [analysisResult, setAnalysisResult] = useState([]);
  const [loading, setLoading] = useState(false);
  const [numPages, setNumPages] = useState(null);

  const onDrop = useCallback((acceptedFiles) => {
    setFiles(
      acceptedFiles.map((file) => ({
        file,
        id: Date.now() + Math.random(),
        name: file.name,
        size: (file.size / 1024).toFixed(2) + " KB", // Convert size to KB
      }))
    );
  }, []);

  const { getRootProps, getInputProps } = useDropzone({
    onDrop,
    accept: {
      "application/pdf": [".pdf"],
    },
  });

  const handleAnalyze = async () => {
    if (files.length === 0) {
      alert("Please select at least one file first.");
      return;
    }

    setLoading(true);
    setUploadMessage("");

    const formData = new FormData();
    formData.append("file", files[0].file);

    try {
      const response = await axios.post(
        "http://127.0.0.1:8000/analyze/",
        formData,
        {
          headers: { "Content-Type": "multipart/form-data" },
        }
      );
      setAnalysisResult(response.data.compliance_issues);
      setFileUrl(response.data.file_url);
      setUploadMessage(`Analysis complete for: ${response.data.filename}`);
    } catch (error) {
      console.error("Error analyzing file:", error);
      setUploadMessage("Error analyzing file.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="md">
      <Paper elevation={3} sx={{ p: 4, mt: 4 }}>
        <Typography variant="h4" gutterBottom align="center">
          Legal Document Upload & Analysis
        </Typography>

        <Box
          {...getRootProps()}
          sx={{
            border: "2px dashed #1976d2",
            borderRadius: 2,
            p: 4,
            textAlign: "center",
            cursor: "pointer",
            mb: 4,
          }}
        >
          <input {...getInputProps()} />
          <CloudUpload sx={{ fontSize: 60, color: "#1976d2", mb: 2 }} />
          <Typography variant="body1">
            Drag & drop a legal document here, or click to select
          </Typography>
        </Box>

        {files.length > 0 && (
          <>
            <Typography variant="h6" gutterBottom>
              Selected File:
            </Typography>
            <List>
              {files.map(({ id, name, size }) => (
                <ListItem key={id}>
                  <ListItemIcon>
                    <InsertDriveFile color="primary" />
                  </ListItemIcon>
                  <ListItemText primary={`${name} (${size})`} />
                </ListItem>
              ))}
            </List>
            <Button
              variant="contained"
              size="large"
              fullWidth
              onClick={handleAnalyze}
              disabled={loading}
            >
              {loading ? <CircularProgress size={24} /> : "Analyze Compliance"}
            </Button>
          </>
        )}

        {uploadMessage && (
          <Typography
            variant="body2"
            color="green"
            align="center"
            sx={{ mt: 2 }}
          >
            {uploadMessage}
          </Typography>
        )}

        {fileUrl && (
          <Box sx={{ mt: 4 }}>
            <Document
              file={fileUrl}
              onLoadSuccess={({ numPages }) => setNumPages(numPages)}
            >
              {[...Array(numPages)].map((_, index) => (
                <div key={index} style={{ position: "relative" }}>
                  <Page pageNumber={index + 1} />
                  {analysisResult
                    .filter((issue) => issue.page === index + 1)
                    .map((issue, i) => (
                      <div
                        key={i}
                        style={{
                          position: "absolute",
                          top: `${issue.y0}px`,
                          left: `${issue.x0}px`,
                          width: `${issue.x1 - issue.x0}px`,
                          height: `${issue.y1 - issue.y0}px`,
                          backgroundColor: "rgba(255, 0, 0, 0.3)",
                        }}
                      />
                    ))}
                </div>
              ))}
            </Document>
          </Box>
        )}
      </Paper>
    </Container>
  );
};

export default DocumentUpload;
